import React, {Component} from "react";
import "../css/newPayment.css";

export default class NewPayment extends Component {

// Konstruktor /////////////////////////////////////////////////////////////////////

// Získání dat ////////////////////////////////////////////////////////////////////

    componentDidMount() {
        document.title = "Nová platba | Web Bank";
    }

// Vykreslení /////////////////////////////////////////////////////////////////////

    render() {

        return(
            <div id="newPaymentContainer">

                <div id="newPayment">
                    <table>
                        <tbody>
                            <tr>
                                <td>
                                    <div>Název platba:</div>
                                </td>

                                <td>
                                    <input type="text" />
                                </td>
                            </tr>

                            <tr>
                                <td>
                                    <div>Číslo účtu:</div>
                                </td>

                                <td>
                                    <input type="text" />
                                </td>

                                <td>
                                    <select>
                                        <option>CZK</option>
                                    </select>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
}
